(function() {
  $(function() {
    var barangays, fetch_barangays, fetch_municipalities, fetch_province, municipalities, provinces, regional_officers, regions, retrieve_barangays, retrieve_municipalities, retrieve_province, retrieve_region;
    regions = $('#subproject_region_id');
    provinces = $('#subproject_province_id');
    municipalities = $('#subproject_municipality_id');
    barangays = $('#subproject_barangay_id');
    regional_officers = $("#regional_officers");
    provinces.attr('readonly', 'readonly');
    municipalities.attr('readonly', 'readonly');
    barangays.attr('readonly', 'readonly');
    fetch_province = function(region_id) {
      var url;
      url = "/provinces.json?region_id=" + region_id;
      return $.get(url, function(data) {
        provinces.empty().attr('disabled', false).removeAttr('readonly');
        municipalities.empty().attr('disabled', 'disabled');
        barangays.empty().attr('disabled', 'disabled');
        provinces.append('<option value></option>');
        return $.each(data, function() {
          return provinces.append($('<option></option>').attr('value', this.id).text(this.name));
        });
      });
    };
    fetch_municipalities = function(province_id) {
      var url;
      url = "/municipalities.json?province_id=" + province_id;
      return $.get(url, function(data) {
        municipalities.empty().attr('disabled', false).removeAttr('readonly');
        barangays.empty().attr('disabled', 'disabled');
        municipalities.append('<option value></option>');
        return $.each(data, function() {
          return municipalities.append($('<option></option>').attr('value', this.id).text(this.name));
        });
      });
    };
    fetch_barangays = function(municipality_id) {
      var url;
      url = "/barangays.json?municipality_id=" + municipality_id;
      return $.get(url, function(data) {
        barangays.empty().attr('disabled', false).removeAttr('readonly');
        barangays.append('<option value></option>');
        return $.each(data, function() {
          return barangays.append($('<option></option>').attr('value', this.id).text(this.name));
        });
      });
    };
    regions.change(function() {
      var rid;
      rid = $(this).val();
      if (rid !== '') {
        return fetch_province(rid);
      } else {
        return $("#subproject_province_id").empty();
      }
    });
    provinces.change(function() {
      var pid;
      pid = $(this).val();
      if (pid !== '') {
        return fetch_municipalities(pid);
      } else {
        return $("#subproject_municipality_id").empty();
      }
    });
    municipalities.change(function() {
      var mid;
      mid = $(this).val();
      if (mid !== '') {
        return fetch_barangays(mid);
      } else {
        return $("#subproject_barangay_id").empty();
      }
    });
    retrieve_region = function(region_id) {
      return $('#subproject_province_id').val(region_id);
    };
    retrieve_province = function(region_id) {
      var url;
      url = "/provinces.json?region_id=" + region_id;
      return $.get(url, function(data) {
        var spi;
        provinces.append('<option value></option>');
        $.each(data, function() {
          return provinces.append($('<option></option>').attr('value', this.id).text(this.name));
        });
        spi = $.urlParam('subproject_province_id') || $.urlParam('province_id');
        if (spi !== undefined && spi !== '' && $("#edit_subproject").length === 0) {
          $('#subproject_province_id').val(spi);
          return retrieve_municipalities(spi);
        }
      });
    };
    retrieve_municipalities = function(province_id) {
      var url;
      url = "/municipalities.json?province_id=" + province_id;
      return $.get(url, function(data) {
        var smi;
        municipalities.append('<option value></option>');
        $.each(data, function() {
          return municipalities.append($('<option></option>').attr('value', this.id).text(this.name));
        });
        smi = $.urlParam('subproject_municipality_id') || $.urlParam('municipality_id');
        if (smi !== undefined && smi !== '' && $("#edit_subproject").length === 0) {
          $('#subproject_municipality_id').val(smi);
          return retrieve_barangays(smi);
        }
      });
    };
    retrieve_barangays = function(municipality_id) {
      var url;
      url = "/barangays.json?municipality_id=" + municipality_id;
      return $.get(url, function(data) {
        var sbi;
        barangays.append('<option value></option>');
        $.each(data, function() {
          return barangays.append($('<option></option>').attr('value', this.id).text(this.name));
        });
        sbi = $.urlParam('subproject_barangay_id') || $.urlParam('barangay_id');
        if (sbi !== undefined && sbi !== '' && $("#edit_subproject").length === 0) {
          return $('#subproject_barangay_id').val(sbi);
        }
      });
    };
    regional_officers.on('change', function() {
      var region_id, url;
      region_id = regional_officers.val();
      url = '/regional_officers/?region_id=' + region_id;
      return window.location.href = url;
    });
    return $(document).ready(function() {
      var mid, pid, rid;
      if (regions.val() !== '') {
        rid = $(regions).val();
        retrieve_province(rid);
      }
      if (provinces.val() !== '') {
        pid = $(provinces).val();
        retrieve_municipalities(pid);
      }
      if (municipalities.val() !== '') {
        mid = $(municipalities).val();
        return retrieve_barangays(mid);
      }
    });
  });

}).call(this);
