(function() {
  $(function() {
    var apply_view, role;
    role = $("#user_role_id");
    $(document).ready(function() {
      return apply_view(role);
    });
    role.change(function() {
      return apply_view(this);
    });
    return apply_view = function(object) {
      var role_text;
      role_text = $("option:selected", object).text();
      if (role_text === "Admin") {
        return $(".show_off").show();
      } else {
        $(".show_off").hide();
        if (role_text === "National" || role_text === "Regional") {
          $(".regional").show();
        }
        if (role_text === "Regional Admin") {
          $(".regional").show();
        }
        if (role_text === "Municipal") {
          $(".regional").show();
          $(".provinces").show();
          $(".municipalities").show();
        }
        if (role_text === "Barangay" || role_text === "Public") {
          $(".regional").show();
          $(".provinces").show();
          $(".municipalities").show();
          return $(".barangays").show();
        }
      }
    };
  });

}).call(this);
